import React from "react";


var mobileno=7894562589
class Myclass extends React.Component
{
    id=121;
    
    email="girish@gmail.com"


    constructor(props)
    {
        super(props);
    }

    myfun()
    {
        return "This is Own Function"
    }

    //prepare the component_i/p
    render()
    {
        var name="Girish"
        return(<>
                <h1>React Class Component</h1>
                {this.id}---{name}---{this.email}---{this.myfun()}---{mobileno}
                </>);
    }
}
export default Myclass
